(1, 'home', 'home', '<div class="shiztitle">\n	<h2 class="title h2bg">\n		Custom T-Shirts | T-Shirt Printing - Izishirt</h2>\n	<div class="about">\n		<p style="float:left;font-color:#D1D8DD;">\n			With IziShirt.com, create your own <strong>custom t-shirts</strong> online in the United States in a few clicks. Choose the model you like from a wide range of shirts and get your personalized t-shirt designs. You can get funny t-shirts and popular t-shirt designs! IziShirt offers great low prices on quality digital screen printed t-shirts! Thanks to a good and long-term relationship with our suppliers such as American Apparel and many more, we are able to offer the best prices on all our products. Our custom t-shirt design tool makes buying your own t-shirts online a fast and easy experience. Our high volume of sales allows you to save money everyday and to enjoy multiple promotions on custom designed t-shirts. With IziShirt.com, the more you buy, the more you save! For the best t-shirt printing choose IziShirt. Make your own t-shirt in USA.</p>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', '<p>\n	<span style="color:red;">Canada Fran&ccedil;ais</span></p>\n', '<div class="shiztitle">\n	<h2 class="title h2bg">\n		T-shirts personnalis&eacute;s | t-shirt personnalis&eacute; - Izishirt</h2>\n	<div class="about">\n		<p style="float:left;">\n			Avec IziShirt.com, cr&eacute;er votre propre t-shirt personnalis&eacute; en ligne aux Etats-Unis en quelques clics. Choisissez le mod&egrave;le qui vous plait parmi une large gamme de chemises et obtenir vos designs de t-shirt personnalis&eacute;s. Vous pouvez obtenir des t-shirts designs populaires T-shirts dr&ocirc;les et plus! IziShirt offre des prix bas sur l&#39;&eacute;cran num&eacute;rique de haute qualit&eacute; t-shirts imprim&eacute;s! Merci &agrave; une bonne et &agrave; long terme relation avec nos fournisseurs tels que American Apparel et bien d&#39;autres, nous sommes en mesure d&#39;offrir les meilleurs prix sur tous nos produits. Notre outil de conception t-shirt personnalis&eacute; permet d&#39;acheter votre propres t-shirts en ligne une exp&eacute;rience rapide et facile. Notre volume &eacute;lev&eacute; de ventes vous permet de faire des &eacute;conomies tous les jours et de profiter de multiples promotions sur des T-shirts con&ccedil;us sur mesure. Avec IziShirt.com, plus vous achetez, plus vous &eacute;conomisez! Pour la meilleure impression t-shirt choisir IziShirt. Faites votre propre t-shirt aux Etats-Unis.</p>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', '<p>\n	<span style="color:red;">Canada English</span></p>\n', 2, 'Active', '2013-03-21 00:00:00'),
(4, 'screen_printing', 'screen_printing', '<p>\n	Get up to 77,5% discount on orders 50 garments and more!<br />\n	Here are the conditions to benefit from the offer:<br />\n	&nbsp;</p>\n<ul>\n	<li>\n		Minimum 50 garments printed for each logo or image</li>\n	<li>\n		Logo/image must contain 1 to 7 solid colors</li>\n	<li>\n		No shaded colors in the logo/image</li>\n</ul>\n', '', '<p>\nObtenez jusqu''à 77,5% de remise sur les commandes de 50 vêtements et plus encore! <br />\nVoici les conditions pour bénéficier de l''offre: <br />\n</ p>\n<ul>\n<li>\nMinimum 50 vêtements imprimés pour chaque logo ou une image </ li>\n<li>\nLogo / image doit contenir 1 à 7 couleurs unies </ li>\n<li>\nPas de couleurs ombrées dans l''image du logo / </ li>\n</ ul>', '', 4, 'Active', '2013-06-24 00:00:00'),
(2, 'about_us', 'About Us', '<p>\n	&nbsp;</p>\n<div class="grid_11 lefthome" style="border: 0px; margin: 0px 10px; padding: 0px; font-size: 13px; display: inline; float: left; width: 640px; color: rgb(0, 0, 0); font-family: Ubuntu; line-height: 19px; ">\n	<div class="about" style="border: 0px; margin: 0px; padding: 0px; color: rgb(125, 131, 136); float: left; line-height: 20px; clear: both; ">\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			What is Izishirt All About?</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			Izishirt is a business running for ten years. We provide customized embroidered or printed apparel. Our products are customized by you, for you. You could choose your order to be in whatever color, style, design, or text you wish. Our website was created to make the best piece of custom clothing you could ever have. We have many dedicated workers taking part in making sure your order is exactly how you want it to be, because the customer is always right.</p>\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			Our designs?</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			The designs of Izishirt are not anything you could buy in stores. With us, YOU are the designer. Our goal is to have everything you order is of your choice and preference. As long as it isn&rsquo;t copyright, your shirt will have your exact specifications.</p>\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			Personalized Apparel?</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			Personalized apparel is just that. There are so many trends these days. You could take any piece of our clothing and make it your own! It&rsquo;ll be original, and unique. And when all your friends ask you where you got it from, be sure to tell them you got your shirt from Izishirt.</p>\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			History About Custom T-Shirts</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			Custom t-shirts are originally from North America. Before 1948, t-shirts were used merely for the military. Custom shirts were being created due to the presidential election of 1948. The Governor of New York, Thomas E. Dewey created shirts to support and promote his campaign. These shirts read &ldquo;Dew it for Dewey.&rdquo; Ever since then, printed t-shirts have been a huge hit.</p>\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			Why custom T-shirts?</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			You can always send us your own designs, but Izishirt has many designers who create and provide designs for our custom apparel. There is a wide range of designs you could choose from. Why custom t-shirts? Because they&rsquo;re designed by you for you.</p>\n		<h3 class="abouthd" style="border: 0px; margin: 0px; padding: 0px 0px 10px; font-size: 16px; float: left; width: 640px; font-weight: normal; ">\n			Our Goal?</h3>\n		<p style="border: 0px; margin: 0px 0px 20px; padding: 0px; ">\n			Our goal is to create the best possible piece of customized apparel we can for you. We&rsquo;re satisfied if you are!</p>\n		<div>\n			&nbsp;</div>\n	</div>\n	<div class="clear" style="border: 0px; margin: 0px; padding: 0px; clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px; ">\n		&nbsp;</div>\n</div>\n<div class="grid_4 righthome" style="border: 0px; margin: 0px 10px; padding: 0px 0px 0px 27px; font-size: 13px; display: inline; float: left; width: 220px; color: rgb(0, 0, 0); font-family: Ubuntu; line-height: 19px; ">\n	&nbsp;</div>\n<p>\n	&nbsp;</p>\n', '', '<p>\n	&nbsp;</p>\n<div>\n	Quel est Izishirt All About?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Izishirt est une entreprise en cours d&#39;ex&eacute;cution depuis dix ans. Nous fournissons des v&ecirc;tements personnalis&eacute;s brod&eacute;s ou imprim&eacute;s. Nos produits sont personnalis&eacute;s par vous, pour vous. Vous pouvez choisir votre afin d&#39;&ecirc;tre en n&#39;importe quelle couleur, style, conception, ou le texte que vous souhaitez. Notre site web a &eacute;t&eacute; cr&eacute;&eacute; pour faire le meilleur morceau de v&ecirc;tement personnalis&eacute; que vous pourriez jamais avoir. Nous avons beaucoup de travailleurs d&eacute;vou&eacute;s qui participent pour s&#39;assurer que votre ordre est exactement la fa&ccedil;on dont vous voulez qu&#39;il soit, parce que le client a toujours raison.</div>\n<div>\n	Nos conceptions?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Les dessins de Izishirt ne sont pas quelque chose que vous pouvez acheter dans les magasins. Avec nous, vous &ecirc;tes le concepteur. Notre objectif est d&#39;avoir tout ce que vous commandez est de votre choix et pr&eacute;f&eacute;rences. Tant que ce n&#39;est pas le droit d&#39;auteur, votre chemise aura vos sp&eacute;cifications exactes.</div>\n<div>\n	Habillement personnalis&eacute;?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Habillement personnalis&eacute; est juste que. Il ya tellement de tendances de nos jours. Vous pouvez prendre n&#39;importe quel morceau de nos v&ecirc;tements et de lui faire vos propres! Ce sera originale et unique. Et quand tous vos amis vous demandent o&ugrave; vous l&#39;avez obtenu, n&#39;oubliez pas de leur dire que vous avez obtenu votre chemise de Izishirt.</div>\n<div>\n	Historique A propos de T-shirts personnalis&eacute;s</div>\n<div>\n	&nbsp;</div>\n<div>\n	T-shirts personnalis&eacute;s sont originaires d&#39;Am&eacute;rique du Nord. Avant 1948, t-shirts ont &eacute;t&eacute; utilis&eacute;s seulement pour les militaires. Shirts personnalis&eacute;s ont &eacute;t&eacute; cr&eacute;&eacute;s en raison de l&#39;&eacute;lection pr&eacute;sidentielle de 1948. Le gouverneur de New York, Thomas E. Dewey cr&eacute;&eacute; chemises pour soutenir et promouvoir sa campagne. Ces chemises lire &quot;ros&eacute;e pour Dewey.&quot; Depuis lors, t-shirts imprim&eacute;s ont &eacute;t&eacute; un &eacute;norme succ&egrave;s.</div>\n<div>\n	Pourquoi T-shirts personnalis&eacute;s?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Vous pouvez toujours nous envoyer vos propres dessins, mais Izishirt a beaucoup de designers qui cr&eacute;ent et fournissent des mod&egrave;les pour nos produits personnalis&eacute;s. Il ya un large &eacute;ventail de mod&egrave;les que vous pouvez choisir. Pourquoi t-shirts personnalis&eacute;s? Parce qu&#39;ils sont con&ccedil;us par vous pour vous.</div>\n<div>\n	Notre objectif?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Notre objectif est de cr&eacute;er le meilleur morceau possible de v&ecirc;tements personnalis&eacute;s que nous pouvons pour vous. Nous sommes satisfaits que si vous &ecirc;tes!</div>\n', '', 1, 'Active', '0000-00-00 00:00:00'),
(3, 'shipping_refund', 'shipping & refund', '<div class="about">\n	<div class="topcontpart">\n		<div class="shipcont">\n			We ship via Canada Post. <img alt="" src="file:///media/namewhatyouwant/new-design/shopping/images/canadapost.jpg" /></div>\n		<div class="freeship">\n			Free shipping in Canada and the US for an order of $75.00 or more.</div>\n		<div class="resive">\n			<p>\n				To receive your order as soon as possible, please make sure:</p>\n			<ul>\n				<li>\n					- There are no abrupt changes in your order</li>\n				<li>\n					- Your order does not involve any copyright protected images</li>\n				<li>\n					- Your payment is made in full</li>\n				<li>\n					- Billing and shipping addresses are correct</li>\n				<li>\n					- There are no problems with the design</li>\n				<li>\n					- The print of the image is good</li>\n			</ul>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title h2bg">\n					Approximate shipping time chart</h2>\n			</div>\n			<table border="4" cellpadding="1" cellspacing="0" class="stardard" width="48%">\n				<tbody>\n					<tr>\n						<th colspan="2">\n							Standard</th>\n					</tr>\n					<tr>\n						<td>\n							Ontario and Quebec:</td>\n						<td>\n							2-4 days</td>\n					</tr>\n					<tr>\n						<td>\n							Other provinces:</td>\n						<td>\n							4-6 days</td>\n					</tr>\n				</tbody>\n			</table>\n			<table border="0" cellpadding="1" cellspacing="1" class="express" width="48%">\n				<tbody>\n					<tr>\n						<th colspan="2">\n							Express</th>\n					</tr>\n					<tr>\n						<td>\n							Ontario and Quebec:</td>\n						<td>\n							1-3 days</td>\n					</tr>\n					<tr>\n						<td>\n							Other provinces:</td>\n						<td>\n							2-4 days</td>\n					</tr>\n				</tbody>\n			</table>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Refunds</h2>\n			</div>\n			<div class="reftxt">\n				We will refund your order if you receive an incomplete order, the image on your garment isn&rsquo;t want you ordered, or if the colour of the garment itself is incorrect. Please note that we will not refund your purchase if your order involves a copyrighted image. Also, YOU send us the picture, so if it&rsquo;s of low quality you will not be refunded. We will try our best to satisfy your needs.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Cancelations</h2>\n			</div>\n			<div class="reftxt">\n				If you wish to cancel an order, it would be preferable to have this done by 9 am the morning after your order has been placed. This is because we start working on our projects as soon as we can. When cancelling an order, you will not be refunded in cash but with an Izishirt coupon. Express orders cannot be cancelled.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Returns</h2>\n			</div>\n			<div class="reftxt">\n				We create all our products based on what you ordered. Since they are your personalized piece of clothing, anything you return cannot be resold. At Izishirt, we make sure that everything you order meets and goes beyond your expectations. If you wish to return your item, we will try everything we can to satisfy you.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Contact Information</h2>\n			</div>\n			<div class="reftxt">\n				<p class="contdelp">\n					If you wish to contact us, you can do so by one of the following:</p>\n				<p class="contdelp">\n					Call us at <span>1-888-800-5787</span></p>\n				<p class="contdelp">\n					Our address: 1625 Chabanel West, Suite 410, Montreal, Quebec, H4N 257</p>\n				<p class="contdelp">\n					<a>See Map</a></p>\n				<p class="contdelp">\n					Our mail: <a href="mailto:contact@izishirt.com">contact@izishirt.com</a></p>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', '', '<div class="about">\n	<div class="topcontpart">\n		<div class="shipcont">\n			Nous exp&eacute;dions via Postes Canada. <img alt="" src="file:///media/namewhatyouwant/new-design/shopping/images/canadapost.jpg" /></div>\n		<div class="freeship">\n			Livraison gratuite au Canada et aux &Eacute;tats-Unis pour une commande de 75,00 $ ou plus.</div>\n		<div class="resive">\n			<p>\n				Pour recevoir votre commande le plus t&ocirc;t possible, s&#39;il vous pla&icirc;t assurez-vous que:</p>\n			<ul>\n				<li>\n					- Il n&#39;y a pas de changements brusques dans votre commande</li>\n				<li>\n					- Votre commande ne comporte pas de droit d&#39;auteur prot&eacute;g&eacute; images</li>\n				<li>\n					- Votre paiement est effectu&eacute; en totalit&eacute;</li>\n				<li>\n					- Adresses de facturation et de livraison sont corrects</li>\n				<li>\n					- Il n&#39;y a pas de probl&egrave;mes avec la conception</li>\n				<li>\n					- L&#39;impression de l&#39;image est bonne</li>\n			</ul>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title h2bg">\n					Tableau approximative de temps d&#39;exp&eacute;dition</h2>\n			</div>\n			<table border="4" cellpadding="1" cellspacing="0" class="stardard" width="48%">\n				<tbody>\n					<tr>\n						<th colspan="2">\n							Norme</th>\n					</tr>\n					<tr>\n						<td>\n							Ontario et au Qu&eacute;bec:</td>\n						<td>\n							2-4 jours</td>\n					</tr>\n					<tr>\n						<td>\n							Autres Provinces:</td>\n						<td>\n							4-6 jours</td>\n					</tr>\n				</tbody>\n			</table>\n			<table border="0" cellpadding="1" cellspacing="1" class="express" width="48%">\n				<tbody>\n					<tr>\n						<th colspan="2">\n							Express</th>\n					</tr>\n					<tr>\n						<td>\n							Ontario et au Qu&eacute;bec:</td>\n						<td>\n							1-3 jours</td>\n					</tr>\n					<tr>\n						<td>\n							Autres Provinces:</td>\n						<td>\n							2-4 jours</td>\n					</tr>\n				</tbody>\n			</table>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Remboursements</h2>\n			</div>\n			<div class="reftxt">\n				Nous rembourserons votre commande si vous recevez une commande incompl&egrave;te, l&#39;image sur votre v&ecirc;tement veut pas que vous avez command&eacute;, ou si la couleur du v&ecirc;tement lui-m&ecirc;me est erron&eacute;e. Veuillez noter que nous ne rembourserons votre achat si votre commande comporte une image prot&eacute;g&eacute;e. En outre, vous nous envoyez la photo, donc si c&#39;est de mauvaise qualit&eacute; vous ne serez pas rembours&eacute;. Nous ferons de notre mieux pour satisfaire vos besoins.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Annulations</h2>\n			</div>\n			<div class="reftxt">\n				Si vous souhaitez annuler une commande, il serait pr&eacute;f&eacute;rable que cela se fasse avant 9 heures le matin apr&egrave;s votre commande a &eacute;t&eacute; pass&eacute;e. C&#39;est parce que nous commen&ccedil;ons &agrave; travailler sur nos projets d&egrave;s que nous le pouvons. Lors de l&#39;annulation d&#39;une commande, vous ne serez pas rembours&eacute; en esp&egrave;ces, mais avec un coupon de Izishirt. Les commandes express ne peuvent &ecirc;tre annul&eacute;es.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					R&eacute;sultats</h2>\n			</div>\n			<div class="reftxt">\n				Nous cr&eacute;ons tous nos produits en fonction de ce que vous avez command&eacute;. Comme ils sont votre pi&egrave;ce personnalis&eacute;e de v&ecirc;tements, tout ce que vous revenez ne peut &ecirc;tre revendu. Au Izishirt, nous nous assurons que tout ce que vous commandez r&eacute;pond et va au-del&agrave; de vos attentes. Si vous souhaitez retourner votre article, nous allons essayer tout notre possible pour vous satisfaire.</div>\n		</div>\n		<div class="appbox">\n			<div class="shiztitle">\n				<h2 class="title1 h2bg1">\n					Coordonn&eacute;es</h2>\n			</div>\n			<div class="reftxt">\n				<p class="contdelp">\n					Si vous souhaitez nous contacter, vous pouvez le faire par l&#39;un des suivants:</p>\n				<p class="contdelp">\n					Appelez-nous au <span>1-888-800-5787</span></p>\n				<p class="contdelp">\n					Notre Adresse: 1625 Chabanel Ouest, bureau 410, Montr&eacute;al, Qu&eacute;bec, H4N 257</p>\n				<p class="contdelp">\n					<a>voir la carte</a></p>\n				<p class="contdelp">\n					Notre courrier: <a href="mailto:contact@izishirt.com">contact@izishirt.com</a></p>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', '', 3, 'Active', '2013-05-13 20:05:08');
